import React from 'react';

class Checkout extends React.Component {
    render(){
        var price = sessionStorage.getItem('data');
        if (price == null ) {
           return( <h1>You have not purchased anything</h1>);
        }
        else {
            return('<h1>Thanks for purchasing . Total Price is</h1>'+price); 
        }

    }
}
export default Checkout;
